Controller.BCS = {
    options: {
        get: function() {
            View.open('bcs_options', window.BCS.options);
        },
        post: function(object) {
            window.BCS.options = object;
        }
    },
    battery: {
        get: function() {
            View.open('bty_setup', window.BCS.battery);
            $('#bty_setup').find('.object.object-nested.gun').not('#gun_template').each(function(){$(this).remove();});
            for (var i = 0; i < window.BCS.battery.guns.length; i++) {
                gun = window.BCS.battery.guns[i];
                this.printGun(gun);
            }
        },
        post: function(object, source) {
            parent = $(source).parents('.object').not('.object-nested');
            guns = [];
            parent.find('.object-nested.gun').not('#gun_template').each(function() {
                gun = Gun.new();
                gunForm = View.helpers.formToModel(this, true, true);
                gun.name = gunForm.name;
                gun.type = gunForm.type;
                console.log(gunForm);
                gun.position = Position.generate(gunForm.position.mgrs_string, gunForm.position.elev);
                if(Gun.validator.validate(gun)) {
                    guns.push(gun);
                }else{
                    View.flash(Gun.validator.errors);
                    return;
                }
            });
            object.guns = guns;
            $("#bty_name").html(object.callsign);
            //window.BCS.battery = object;
            $.extend(window.BCS.battery, object);
            $('select.gun-select').each(function(){
                $(this).empty();
                $(this).append('<option value="All">Battery</option>');
                for (var i = 0; i < guns.length; i++) {
                    $(this).append('<option value="'+guns[i].name+'">Piece ' + guns[i].name + '</option>');
                }
            });
        },        
        printGun: function(sourceGun) {
            console.log('printing');
            gun = $('#gun_template').clone();
            gun.attr('id','');
                console.log('populate with', sourceGun);
            if(sourceGun != null)
            {
                View.populate(gun, sourceGun);
            }
            $('#gun_list').append(gun);
            gun.show();
        },
        deleteGun: function(gun) {
            parent = $(gun).parents('.object.object-nested.gun');
            console.log(gun, parent);
            parent.remove();
        }
    },
    ammo: {
        get: function() {
            View.open('bty_ammo', window.BCS.battery);
        },
        post: function(object, source) {
            window.BCS.battery.ammo = object.ammo;
        },
        process: function(eomObject) {
            updateAmmo = function(type, count) {
                $.each(window.BCS.battery.ammo, function() {
                    if(this.name == type)
                    {
                        this.count-=count;
                    }
                });
            };

            updateAmmo(eomObject.adjust.shell, eomObject.adjust.shellsFired);
            updateAmmo(eomObject.ffe.shell, eomObject.ffe.shellsFired);
        }
    },
    points: {
        get: function() {
            View.open('bty_points', window.BCS.knownPoints);
            $('#bty_points').find('.object.object-nested.point').not('#point_template').each(function(){$(this).remove();});
            $.each(BCS.knownPoints, function(){
                Controller.BCS.points.add(this);
            });
        },
        post: function(object, source) {
            parent = $(source).parents('.object').not('.object-nested');
            guns = [];
            parent.find('.object-nested.point').not('#point_template').each(function() {
                point = StoredPoint.new();
                pointForm = View.helpers.formToModel(this, true, true);
                point.name = pointForm.name;
                point.type = pointForm.type;
                point.friendly = pointForm.friendly;
                console.log(pointForm);
                point.position = Position.generate(pointForm.position.mgrs_string, pointForm.position.elev);
                if(StoredPoint.validator.validate(point)) {
                    BCS.knownPoints[point.name] = point;
                }else{
                    View.flash(StoredPoint.validator.errors);
                    return;
                }
            });
        },
        add: function(basePoint) {
            point = $('#point_template').clone();
            point.attr('id','');
            if(basePoint != null) {
                View.populate(point, basePoint);
            }
            $('#point_list').append(point);
            point.show();
        },
        delete: function(source) {
            parent = $(source).parents('.object.object-nested.point');
            name = parent.find('.variable[key="name"]').val();
            console.log(name);
            delete BCS.knownPoints[name];
            parent.remove();
        }
    }
}

